import React, { Component } from "react";

export default class UserProfile extends Component {
  constructor (props) {
    super(props)

    const { apiReturn } = this.props;
  }

  render() {
    const result = this.props.apiReturn[0];
    return (
      <div>
        <img src={result.picture.medium} alt={result.name.last}></img>
        <p>`${result.name.first} ${result.name.last}`</p>
        <p>`${result.email}`</p>
        <p>`${result.dob.age}`</p>
      </div>
    )
  }


}
